import React from 'react';
import { SelectOptionWrapper } from './style';
const SelectOption = props => {
    const {option} = props
    return(
        <SelectOptionWrapper value="" name="">
            <option value=""></option>
        </SelectOptionWrapper>
    );
}
export default SelectOption;
